import './App.css';
import Layout from "./hoc/Layout/Layout";
import {Routes, Route, BrowserRouter as Router,} from 'react-router-dom'
function App() {
   let addRouters =(
      <Routes>
          <Route path="/" element={<h1>1</h1>} />
          <Route path="/add-word" element={<h1>2</h1>} />
          <Route path="/learn-words" element={<h1>3</h1>} />
          <Route path="/words-list" element={<h1>4</h1>} />
      </Routes>
  );

  return (
      <Router>
          <Layout>
              {addRouters}
          </Layout>
      </Router>
  );
}

export default App;
